import React from 'react';
import style from 'styled-components';
import MovieCard from '../components/MovieCard';

const SearchWrapper = style.div`

    margin-top: 33px;
    display: flex;
    justify-content: space-between;
    flex-wrap: wrap;


`;


export default function SearchList({ movies, addMovie, nominates }) {

    return (
        <SearchWrapper>
                {
                    movies.map((movie) => {

                        let isNominated = false;

                        for(const nominate in nominates) {
                            if (nominate.imdbID === movie.imdbID) {

                                return;
                            } else {
                                return;
                            }
                        }
                        return <MovieCard btnLabel={"Nominate"} nominates={nominates} addMovie={addMovie} movie={movie}/>
                    })
                }
        </SearchWrapper>
    )
}
